import React from 'react'
// import { Component } from 'ag-grid-community';
// import GoogleLogin from 'react-google-login';
// or
import "../static/style.css"
import { GoogleLogin } from 'react-google-login';
const responseGoogle = (response) => {
    console.log(response);
}
class Register extends React.Component{
    constructor(props){
        super(props)
        this.state={
            name:'',
            email:'',
            password:''            
        }
        this.userLogin= this.userLogin.bind(this)

        // this.responseGoogle= this.responseGoogle.bind(this)
    }
    userLogin(event){
        event.preventDefault()
        console.log("password value",this.state.password)
    }
    // responseGoogle(data){
    //     console.log("got user")
    //     console.log("user data",data.profileObj);
    // }
      render(){
        return(
            <React.Fragment>
                <h1> Register page</h1>
                    <div className="wrapper fadeInDown">
                        <div id="formContent">
                        {/* Tabs Titles */}
                        {/* Icon */}
                        <div className="fadeIn first">
                            <img src="https://png.pngtree.com/svg/20161229/_username_login_1172579.png" id="icon" alt="User Icon" />
                        </div>
                        {/* Login Form */}
                        <form onSubmit={this.userLogin.bind(this)}>
                            <input type="text" id="login" className="fadeIn second" name="name" placeholder="Name" />
                            <input type="text" id="login" className="fadeIn second" name="email" placeholder="Email" />
                            <input type="text" id="password" className="fadeIn third" name="password" placeholder="password" />
                            <input type="submit" className="fadeIn fourth" defaultValue="Log In" onChange={(e)=>{
                                this.setState({
                                    password:e.target.value
                                })
                            }} />
                        </form>
                        {/* Remind Passowrd */}
                        <div id="formFooter">
                            {this.state.password}
                            <a className="underlineHover" href="#">Forgot Password?</a>
                        </div>
                        </div>
                    </div>
            </React.Fragment>
            
        );
    }
}
export default Register;
